package co.fin.core.kjh.customer.vo;

public class CustomerVo {
	private String customer_id;
	private String customer_pw;
	private String customer_addr;
	private String customer_email;
	private String customer_name;
	private String customer_company_name;
	private String customer_phone;
	private String customer_profile;
	
	public CustomerVo() {
		// TODO Auto-generated constructor stub
	}

	public String getCustomer_id() {
		return customer_id;
	}

	public void setCustomer_id(String customer_id) {
		this.customer_id = customer_id;
	}

	public String getCustomer_pw() {
		return customer_pw;
	}

	public void setCustomer_pw(String customer_pw) {
		this.customer_pw = customer_pw;
	}

	public String getCustomer_addr() {
		return customer_addr;
	}

	public void setCustomer_addr(String customer_addr) {
		this.customer_addr = customer_addr;
	}

	public String getCustomer_email() {
		return customer_email;
	}

	public void setCustomer_email(String customer_email) {
		this.customer_email = customer_email;
	}

	public String getCustomer_name() {
		return customer_name;
	}

	public void setCustomer_name(String customer_name) {
		this.customer_name = customer_name;
	}

	public String getCustomer_company_name() {
		return customer_company_name;
	}

	public void setCustomer_company_name(String customer_company_name) {
		this.customer_company_name = customer_company_name;
	}

	public String getCustomer_phone() {
		return customer_phone;
	}

	public void setCustomer_phone(String customer_phone) {
		this.customer_phone = customer_phone;
	}

	public String getCustomer_profile() {
		return customer_profile;
	}

	public void setCustomer_profile(String customer_profile) {
		this.customer_profile = customer_profile;
	}
	
	
	
}
